import React, { useState } from "react";

import "react-vis/dist/style.css";

import "./App.css";
import { GlobalExplanations, LocalExplanation, Table } from "./components";

const features = [
  "LotArea",
  "YearBuilt",
  "GrLivArea",
  "KitchenAbvGr",
  "FirstFlrSF",
  "PoolArea",
  "TotalBsmtSF",
  "BsmtFinSFOne",
  "BsmtUnfSF",
  "GarageYrBlt",
  "EnclosedPorch",
  "WoodDeckSF",
  "MSSubClass",
  "MiscVal",
  "OpenPorchSF",
  "ThreeSsnPorch",
  "YearRemodAdd",
  "YrSold",
  "GarageArea",
  "LowQualFinSF",
  "BsmtFinSFTwo",
  "OverallCond",
  "MoSold",
  "SecondFlrSF",
  "TotRmsAbvGrd",
  "ScreenPorch",
  "Fireplaces",
  "OverallQual",
  "HalfBath",
  "MasVnrArea",
  "GarageCars",
  "LotFrontage",
  "BsmtFullBath",
  "FullBath",
  "BedroomAbvGr",
  "BsmtHalfBath",
];

const tableRows = new Array(tableColumns.length).fill(1).map(() => {
  const row = {};
  tableColumns.forEach(
    (tableColumn) => (row[tableColumn] = Math.random() * 1000 - 500)
  );
  return row;
});

function App() {
  const [selectedRowIndex, setSelectedRowIndex] = useState();

  return (
    <main>
      <GlobalExplanations
        features={features}
        selectedRowIndex={selectedRowIndex}
        tableRows={tableRows}
      />
      <LocalExplanation
        features={features}
        selectedRowIndex={selectedRowIndex}
        tableRows={tableRows}
      />
      <Table
        features={features}
        setSelectedRowIndex={setSelectedRowIndex}
        selectedRowIndex={selectedRowIndex}
        rows={tableRows}
      />
    </main>
  );
}

export default App;
